import React from "react";

class Oclock extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      oclock: new Date().toLocaleTimeString(),
    };
  }

  render() {
    return (
      <div>
        <p>{this.state.oclock}</p>
      </div>
    );
  }
}
this.setState({ oclock: setInterval(1000) });
export default Oclock;
